    setAnchorEl(event.currentTarget);
  };
  const handleClose = () => {
    setAnchorEl(null);
  };


  const history = useHistory()

  const handleLogout = () => {
    localStorage.removeItem("token")
    localStorage.removeItem("user")
    history.replace("/login")
  }
